var str = "Trump 34, Rubio 18, Cruz 19, Bush 12, Kasich 8, Carson 5";
var candidates = str.split(', ');
for (var i = 0; i < candidates.length; i++) {
    spr = candidates[i].split(' ');
    num = {
        name: spr[0],
        percent: parseInt(spr[1])
    };
    candidates[i] = num;
}

console.log(candidates);